  const buscarCedula = () => {
    const h2=document.getElementById("tituloh2");
    const cedulaBuscada = document.getElementById("cedulaInput").value;
    const resultados = data.filter((obj) => obj.cedula === cedulaBuscada);
    const tablaResultados = document.getElementById("tablaResultados");
    if(resultados.length>0){
      // limpiar tabla de resultados previos
    tablaResultados.innerHTML = "";
  
    // agregar encabezado de tabla
    const encabezado = "<tr><th>Identificación</th><th>Nombre</th><th>Número Proceso</th><th>Estado</th><th>Ver</th></tr>";
    tablaResultados.innerHTML += encabezado;
  
    resultados.forEach((obj) => {
      // agregar fila a la tabla
      
        const fila = `<tr><td>${obj.cedula}</td><td>${obj.nombre}</td><td>${obj.apellido}</td><td>${obj.estado}</td><td><button class="button" onclick="verEstado('${obj.nombre}', '${obj.estado}')">Ver</button></td></tr>`;
        tablaResultados.innerHTML += fila;
      
      
    });
    h2.innerText="Resultados";

    }else{
      const emergente=window.open("","Ventana Emergente", "width=1400,height=1000");
      emergente.document.write(`<img src="img/estados/default.jpg">`)
    }
  
    
  };
  
  const verEstado = (nombre, estado) => {
    const ventanaEmergente = window.open("", "Ventana Emergente", "width=1400,height=1000");
  
    let imagen;
    switch (estado) {
      case "ENTREGA DOCUMENTOS Y PAGO DE HONORARIOS":
        imagen = "img/estados/1.jpg";
        break;
      case "ESTUDIO DE TÍTULOS PRELIMINAR":
        imagen = "img/estados/2.jpg";
        break;
      case "ENTREGA DE AVALÚO":
        imagen = "img/estados/3.jpg";
        break;
      case "ESTUDIO DE TÍTULOS DEFINITIVO":
        imagen = "img/estados/4.jpg";
        break;
      case "SANEAMIENTO JURÍDICO":
        imagen = "img/estados/5.jpg";
        break;
      case "CARTA DE RATIFICACION":  //Este no esta en el archivo de Excel preguntar.! Columna O
        imagen = "img/estados/3.jpg";
        break;
      case "REMISIÓN DOCUMENTOS A NOTARÍA":
        imagen = "img/estados/7.jpg";
        break;
      case "INICIO ESCRITURACIÓN":
        imagen = "img/estados/8.jpg";
        break;
      case "REVISIÓN Y FIRMA ESCRITURA ":
        imagen = "img/estados/9.jpg";
        break;
      case "REMISIÓN DE ESCRITURA A NOTARÍA":
        imagen = "img/estados/10.jpg";
        break;
      case "PAGO DE RENTAS Y REGISTRO ":
        imagen = "img/estados/11.jpg";
        break;
      case "BOLETA DE INGRESO A REGISTRO":
        imagen = "img/estados/12.jpg";
        break;
      case "CONTROL GARANTIAS Y ENTREGA ESCRITURAS":
        imagen = "img/estados/13.jpg";
        break;
      case "NOVEDADES DE REGISTRO":
        imagen = "img/estados/14.jpg";
        break;
      default:
        imagen = "img/estados/default.jpg";
        break;
    }
  
    ventanaEmergente.document.write(`<h2>${nombre}</h2><img src="${imagen}"><p>${estado}</p>`);
  };
  